import "./App.css";
import { Route } from "react-router";
import BackgroundVideo from './image/gif.mp4'

import Home from "./components/Home";

function App() {
  return (
    <>
    <video
    id="backgroundVideo"
    autoPlay
    loop
    muted
  >
    <source
      src={BackgroundVideo}
      type="video/mp4"
    />
  </video>
    <div className="App">

      <Home />
    </div>
    </>
  );
}

export default App;
